import React, { Component } from "react";
import "./App.scss";

// Компоненты
import TodoHeader from "./components/TodoHeader/TodoHeader";

class App extends Component {
  state = {
    logoName: ["logo", "Changed"],
    i: 0,
  };

  render() {
    return (
      <div className="App">
        <TodoHeader />
      </div>
    );
  }
}

export default App;
